ISLAMABAD, Feb 9 (APP):Pakistan Peoples Party Parliamentarians’ Makhdoom Mehboob Zaman has won the Sindh Assembly election from PS-56, Mitiari-I by securing 72,178 votes.
According to unofficial result issued by the Returning Officer/ECP, his runner up was Naseer Ahmed of Pakistan Muslim League-Nawaz (PML-N) who bagged 35,432 votes.
